INSERT INTO `jdy_dynamic` (`id`, `cat_id`, `exam_type_id`, `title`, `content`, `create_time`, `pic_path`, `update_time`, `keywords`, `description`, `paixu`, `link_url`, `status`, `view`) VALUES
(5, 1, 0, '关于我们', '<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<div class=\"box_tit\" align=\"center\">\r\n	<span>简单实用，实事求是。</span> \r\n	<p>\r\n		<b>解放决策者思想，一切从实际情况出发，</b>让网站、小程序简单实用。\r\n	</p>\r\n	<p>\r\n		<br />\r\n	</p>\r\n	<p>\r\n		简单实用：让用户体验明了简单、企业使用经济实用，如冰山露出水面的一角, 简单其实并不简单。 <br />\r\n水面下的看不见的部分经过了体系化架构，严格的流程执行，体系流程复杂是为了体验使用简单，让其回归本质，规避了风险。\r\n	</p>\r\n	<p>\r\n		<br />\r\n	</p>\r\n	<p>\r\n		<br />\r\n	</p>\r\n	<p>\r\n		<br />\r\n	</p>\r\n	<p>\r\n		&nbsp;每天，都有大量的创业者怀揣着梦想上路，固安大树希望能为他们实现梦想的路上提供技术服务，为他们送上<strong>助力和美好祝福</strong>，与他们一起并肩奋斗。\r\n	</p>\r\n	<p>\r\n		很多企业已经有网站、小程序、App等技术基础，需要维护更新升级发挥价值，我们能竭诚的提供简单实用的技术服务支持。\r\n	</p>\r\n	<p>\r\n		固安大树网络科技有限公司成立于2021年10月，<strong>致力于为企业提供简单实用的企业技术服务</strong>。我们有20多年的网站开发行业服务经验。\r\n	</p>\r\n	<p>\r\n		如果您的企业也需要技术服务，请随时联系固安大树，我们愿意与您一起解决问题，一起进步。\r\n	</p>\r\n	<p>\r\n		为您提供顾问式技术服务，为您的网站、小程序、App等信息化之路保驾护航。\r\n	</p>\r\n	<p>\r\n		<br />\r\n	</p>\r\n	<h3>\r\n		<strong>服务热线：</strong><strong>19903265220</strong> \r\n	</h3>\r\n	<div>\r\n		<p>\r\n			地址：河北省廊坊市固安县迎宾大道西侧、工兴西街南侧文创园46号楼1单元608室\r\n		</p>\r\n		<p>\r\n			<br />\r\n		</p>\r\n		<p>\r\n			<br />\r\n		</p>\r\n	</div>\r\n</div>\r\n<p align=\"center\">\r\n	<strong>扫一扫加微信联系我们</strong>\r\n</p>\r\n<p align=\"center\">\r\n	<img src=\"data:image/png;base64,\" alt=\"\" /> \r\n</p>', 1637463754, '', 0, '关于我们', '关于我们，固安大树的介绍', 6, '', 0, 20);
