(8, 2, 0, '持续为企业提供技术能量', '科技2', 1637465630, '/uploads/dynamic/dynamic_8.jpg', 0, '科技2', '科技2', 0, '', 0, 1),
(9, 7, 0, '中小企业需要什么样的网站？', '<p>\r\n	每一个网站，如每个人的面孔是独一无二的，由每个企业的实际情况而决定。网站为企业服务，应该量身定制，提升品牌形象和可信度，需要专业建站顾问，本地化上门服务。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	&nbsp;让用户看见企业的真实情况是网站的目标，平等对待每一位用户，让用户清晰明了，顺利的看到想看的，用户常能从网站上看到网站的目标，网站就是真实有用的，这样就是好的网站。<br />\r\n<br />\r\n网站上展示的企业真实内容要是谦下的，真实的，给用户看到的是合理、合法的，友好的，诚信的，真诚的，尊重的感受。<br />\r\n<br />\r\n企业的真实客观情况，以用户为中心结合为用户服务体验为原则，客观的事实为案例呈现到网站上，去掉企业主观意念想出来的虚幻不实际的案例，不要展示。<br />\r\n<br />\r\n网站内容不能偏离企业真实客观情况，网站的功能应用，要以企业当下实际情况为准则，不能受社会环境影响随波逐流。<br />\r\n<br />\r\n结合企业实际情况出发，网站即简单有实用，是对广大用户的尊敬。<br />\r\n<br />\r\n&nbsp;如果不从企业实际情况出发，网站追求时髦、高大上、主观臆想的功能就会变的复杂不实用，就会浪费人力物力，给用户不好的影响，起反作用。<br />\r\n<br />\r\n如果网站不是企业真实情况，用户看了后，合作过程中发现不是网上说的那样，感觉被欺骗，就是合作成了 ，也会有不好的印象。<br />\r\n<br />\r\n如果网站内容自我的夸大，用户也会了解竞争对手等相关信息看出满目自大，自然会有有被轻视傲慢对待的感觉。<br />\r\n<br />\r\n网站内容每一个部分都是企业真实情况，都平等正直的为客户考虑就是好网站。<br />\r\n<br />\r\n企业真实情况如果相对差，也不要担心，也要以真实展示。然后就要不断的发展更新真实情况，用户会伴随企业一起成长。<br />\r\n<br />\r\n企业真实情况首先企业决策人要自己正视，真知的看清楚明白，然后再开始建立网站。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	建立网站后要持续维护使用，给企业带来价值，就需要持续不断的服务。\r\n</p>', 1637482459, '/uploads/dynamic/dynamic_9.jpg', 0, '', '每一个网站，如每个人的面孔是独一无二的，由每个企业的实际情况而决定。网站为企业服务，应该量身定制，提升品牌形象和可信度，需要专业建站顾问，本地化上门服务。', 0, '', 0, 11),
(10, 7, 0, '模板建站和独立建站，独立建站费用太高，模板站划算，真的是这样吗？', '<p>\r\n	很多企业非常重要的一件事就是建站，因为网站是是一个企业的门面，客户们无法到实地看你的产品及公司，企业网站是了解你产品和公司最直接的途径。\r\n</p>\r\n<br />\r\n<p>\r\n	那么建站该如何选择呢？\r\n</p>\r\n<p>\r\n	很多企业会发现，市面上建站的价格悬殊很大，便宜的有几百元甚至几十元的模板建站，贵的几千上万的独立建站，那么这两种为什么价格差异这么大呢？\r\n</p>\r\n<p>\r\n	又各有什么样的好处?\r\n</p>\r\n<div align=\"center\">\r\n	<img src=\"/uploads/attached/image/20211121/20211121201109_23589.jpg\" alt=\"\" /><br />\r\n</div>\r\n<p>\r\n	<b><br />\r\n</b> \r\n</p>\r\n<p>\r\n	<b>模板建站的优点</b>：\r\n</p>\r\n<p>\r\n	①时间短，模板建站一般只需要一到两个工作日即可，对于急需网站的企业来说，可以选择模板网站临时使用。\r\n</p>\r\n<p>\r\n	②价格低，相信这是很多小型企业选择模板建站的主要原因，几百元的价格就可以拥有一个企业网站。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<b>模板建站的缺点</b>：\r\n</p>\r\n<p>\r\n	①模板重复性严重\r\n</p>\r\n<p>\r\n	由于模板网站提供的模板终究有限，在互联网上会大量重复存在，而重复网站是搜索引擎很不喜欢的东西，所以一般情况下也很难得到搜索引擎的重视，对于开展SEO、网络推广等是一个很不利的因素。\r\n</p>\r\n<p>\r\n	②模板建站\r\n</p>\r\n<p>\r\n	模板网站是自动生成的网站，网站结构无法自由编辑，不能合理的规划和更改网站内部结构，很多程序框架都是写死的，无法进行二次开发，如果要增加新的功能点只能把原有的网站全部推倒重做。\r\n</p>\r\n<p>\r\n	③只有使用权，没有属于权\r\n</p>\r\n<p>\r\n	网站的版权是归建站公司所有的，你只有使用权，而且每年都需要交费，相当于这些钱只能用一年。如果网站提供者服务器出现问题，网站一定是打不开的，如果网站模版系统需要升级，网站也会出现打不开的情况。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	④多个用户共用一套系统，同时在线的人越多，网站速度越慢。而且代码结构非常复杂，因为一套代码要照顾到多个客户，所以很难被搜索引擎抓取，也很难做优化工作。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	⑤模版网站没有独立的备案号码，是所有用户共用一个备案号，如果信产部要查封的话，客户是得不到任何保障的。模版网站容易中木马，模版服务器上只要有一个网站中木马或者是被查封，其他网站就全部会中木马或者查封。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<b>独立建站的优点</b>：\r\n</p>\r\n<p>\r\n	①定制化，展现公司特点，网页设计的风格可根据客户的需求来量身打造，与众不同。\r\n</p>\r\n<p>\r\n	②搜索引擎友好\r\n</p>\r\n<p>\r\n	定制网站符合搜索引擎规则，更容易优化，使您的网站在后期推广过程中具有搜索引擎良好的适应性。\r\n</p>\r\n<p>\r\n	③响应式\r\n</p>\r\n<p>\r\n	现在大多定制网站都属于响应式网站，什么是响应式？简单来说就是电脑上、平板上、手机上打开同样的网站都能自动适应调整，使网站看上去更美观，用户体验度更高。\r\n</p>\r\n<p>\r\n	④归属权\r\n</p>\r\n<p>\r\n	定制建设网站都是一次性费用，只需续费服务器、域名即可。\r\n</p>\r\n<p>\r\n	⑤售后方便\r\n</p>\r\n<p>\r\n	与模板建站不同的是，现在很多正规建站公司都会提供售后服务，包括网站更新、网站调整等。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<b>独立建站的缺点</b>：\r\n</p>\r\n<p>\r\n	①时间长：独立建站花费时间较长，一般在一到两个才能完成。\r\n</p>\r\n<p>\r\n	②价格高：对应其强大的能力价格当然也不会很低，对于刚起步的小型企业确实有些压力。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', 1637496379, '/uploads/dynamic/dynamic_10.png', 0, '模板建站,独立建站', '模板建站和独立建站各有优缺点，可以根据企业的实际情况来选择！模板建站时间短速度快有一定限制，独立开发的网站灵活，自主修改，可以在众多同行中凸显出客户公司的文化特征，吸引潜在客户，达到做网站的基本要求。', 0, '', 0, 12),
